import React from 'react';
import { Fragment } from 'react';
import Acontext from './Context';

const Provider = () => {
    const mission = {
        mname: "Rescue the animal from south africa",
        agent: "Captain Anurag",
        status: "Not acceted"
    }
    
    return (
        <Fragment>
            <Acontext.Provider value={{data:mission}}>
                {props.children}
            </Acontext.Provider>
        </Fragment>
    );
}



export default Provider;
